import{_ as a,c as e,o as t,R as s}from"./chunks/framework.27a1c15b.js";const o="/activesim.png",r="/usage.png",i="/overage.png",n="/usagechart.png",d="/heatmap.png",y=JSON.parse('{"title":"🕹️ Dashboard","description":"","frontmatter":{},"headers":[],"relativePath":"guide/dashboard.md","lastUpdated":1685164650000}'),h={name:"guide/dashboard.md"},l=s('<h1 id="dashboard" tabindex="-1">🕹️ Dashboard <a class="header-anchor" href="#dashboard" aria-label="Permalink to &quot;:joystick: Dashboard&quot;">​</a></h1><h2 id="📊-dashboard-analysis" tabindex="-1">📊 Dashboard Analysis <a class="header-anchor" href="#📊-dashboard-analysis" aria-label="Permalink to &quot;📊 Dashboard Analysis&quot;">​</a></h2><p>Cube dashboard enables and renders a statistical analyis of your assets for a better business visibility and easier strategizing.</p><h3 id="information-cards" tabindex="-1">Information Cards <a class="header-anchor" href="#information-cards" aria-label="Permalink to &quot;Information Cards&quot;">​</a></h3><h3 id="_1-active-sims" tabindex="-1">1. Active SIMs <a class="header-anchor" href="#_1-active-sims" aria-label="Permalink to &quot;1. Active SIMs&quot;">​</a></h3><p>This card shows all the <strong>activated SIM</strong> that your organisation owns and uses and the <strong>monthly trend</strong> of the count. Click to jump to SIM list that displays all the activated cards (filtered)</p><div class="info custom-block"><p class="custom-block-title">SIM Status</p><p>To know more about various SIM status and how each one works, click <a href="./simstatus.html">here</a></p></div><p><img src="'+o+'" alt="Card - Active SIMs"></p><h3 id="_2-current-usage" tabindex="-1">2. Current Usage <a class="header-anchor" href="#_2-current-usage" aria-label="Permalink to &quot;2. Current Usage&quot;">​</a></h3><p>Total data usage of all the cards in use since the <strong>1st day of current month</strong>. Refreshed daily.</p><p><img src="'+r+'" alt="Card - Current Usage"></p><h3 id="_3-overage-sims" tabindex="-1">3. Overage SIMs <a class="header-anchor" href="#_3-overage-sims" aria-label="Permalink to &quot;3. Overage SIMs&quot;">​</a></h3><p>Number of SIMs that have experienced <strong>data overage</strong> in current billing cycle and the total data overage. (It could lead to extra cost depending on the billing mode.)</p><p>click to jump to SIM list to check the overage SIMs in detail. <img src="'+i+'" alt="Card - Total Overage"></p><h3 id="_4-expire-soon" tabindex="-1">4. Expire Soon <a class="header-anchor" href="#_4-expire-soon" aria-label="Permalink to &quot;4. Expire Soon&quot;">​</a></h3><p>Number of SIMs that will <strong>expire soon ( in 45 days)</strong>.Click to jump to SIM list to check on those SIMs.</p><h3 id="usage-overview-chart" tabindex="-1">Usage Overview Chart <a class="header-anchor" href="#usage-overview-chart" aria-label="Permalink to &quot;Usage Overview Chart&quot;">​</a></h3><p>In the chart you may view your data/sms usage in different timeframes. The update frequency varies, depending on different MNOs&#39; system synchronization stretegies.</p><div class="warning custom-block"><p class="custom-block-title">Latency</p><p>More commonly, expect a latency that spans between 10 minutes ~ 24 hours.</p></div><p><img src="'+n+'" alt="Card - Usage Chart"></p><h2 id="🌎-dashboard-heatmap" tabindex="-1">🌎 Dashboard - Heatmap <a class="header-anchor" href="#🌎-dashboard-heatmap" aria-label="Permalink to &quot;🌎 Dashboard - Heatmap&quot;">​</a></h2><p>Heatmap shows the geographical (according to Mobile Country Code) distribution of all your Active SIM assets based on their last 24-hour activity.</p><div class="info custom-block"><p class="custom-block-title">Active SIMs</p><p>Active SIMs refer to those that have at least 1 CDR data in the last 24(default)/48/72 hours (selectable)</p></div><ul><li><p>SIMs are grouped and counted by the <strong>Mobile Country Code</strong> (regions may have different MCC even though they belong to the same country)</p></li><li><p><strong>Darker</strong> the color, <strong>more SIMs</strong> are inside that region.</p></li></ul><p><img src="'+d+'" alt="heatmap illustration"></p>',25),c=[l];function p(u,m,g,b,v,_){return t(),e("div",null,c)}const S=a(h,[["render",p]]);export{y as __pageData,S as default};
